import React from "react";
import '../Styles/Header.css'
function Header(){

    return(
        <header>
            <a href="#"><a href="#">Login</a></a>
            <a href="#">Sobre</a>
            <div className="HbarraPesquiza">
            <input type="text"/><button onClick="">Search</button>
            </div>
            <a href="#">Cadastrar</a>
            <a href="#">Login</a>
        </header>
    )
}

export default Header
